import { SharedCard } from './SharedCard';
import { CircularProgress } from './CircularProgress';

export const CardSessionsReport = () => {
  const title = `Sessions showing improvement`;
  const image = (
    <CircularProgress
      stepCurrent={6}
      stepBase={10}
      foregroundColor={Colors.AQUA}
      backgroundColor={Colors.LIGHT_GRAY}
    />
  );
  const description = `Sessions started with high tremor and showed a 61% reduction.`;
  const navLink = 'SessionsScreen';
  const nextButton = true;

  return (
    <>
      <SharedCard
        title={title}
        image={image}
        description={description}
        navLink={navLink}
        nextButton={nextButton}
      />
    </>
  );
};
